import React, { useState } from 'react';
import axios from 'axios';
import './registerOwner.css'; // Import CSS file for styling

function RegisterOwner() {
    const [ownerData, setOwnerData] = useState({
        flat_no: '',
        name: '',
        address: '',
        mobile_no: '',
        email: '',
        password: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setOwnerData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('YOUR_API_ENDPOINT', ownerData);
            console.log('Owner data submitted successfully!', response.data);
            setOwnerData({
                flat_no: '',
                name: '',
                address: '',
                mobile_no: '',
                email: '',
                password: ''
            });
        } catch (error) {
            console.error('Error submitting owner data:', error);
        }
    };

    return (
        <form onSubmit={handleSubmit} className="owner-form"> {/* Add class name for styling */}
            <input
                type="text"
                name="flat_no"
                placeholder="Flat Number"
                value={ownerData.flat_no}
                onChange={handleChange}
                className="form-control" 
            />
            <input
                type="text"
                name="name"
                placeholder="Name"
                value={ownerData.name}
                onChange={handleChange}
                className="form-control" 
            />
            <input
                type="text"
                name="address"
                placeholder="Address"
                value={ownerData.address}
                onChange={handleChange}
                className="form-control" 
            />
            <input
                type="text"
                name="mobile_no"
                placeholder="Mobile Number"
                value={ownerData.mobile_no}
                onChange={handleChange}
                className="form-control" 
            />
            <input
                type="email"
                name="email"
                placeholder="Email"
                value={ownerData.email}
                onChange={handleChange}
                className="form-control" 
            />
            <input
                type="password"
                name="password"
                placeholder="Password"
                value={ownerData.password}
                onChange={handleChange}
                className="form-control" 
            />
            <button type="submit" className="btn-submit">Submit</button> 
        </form>
    );
}

export default RegisterOwner;
